import React from "react";
import img from "../todo_img.png";

const Todo = () => {
  return (
    <>
      <div className="main-div">
        <div className="child-div">
          <figure className="fig_div">
            <img className="img_div" src={img} alt="todo_img" />
            <figcaption>Add Your List Here</figcaption>
          </figure>

          <div className="addItems">
            <input type="text" placeholder="✍️ Add Items..." />
            <span className="material-symbols-outlined" title="Add Item">add_circle</span>
          </div>

          <div className="showItems">
            <div className="eachItem">
              <h3>Apple</h3>
              <span className="material-symbols-outlined" title="Delete Item">delete</span>
            </div>
          </div>
        </div>
      </div>
    </>
  );
};

export default Todo;
